import React, { useLayoutEffect, useEffect, useState } from "react";
import { View, Text, Button, Image } from "react-native";
import axios from "axios";
import { Con, Card, SafeCon, ListCard } from "../assets/common/common";
import { SafeAreaView } from "react-native-safe-area-context";
import Icon from "react-native-vector-icons/FontAwesome";
import styled from "styled-components/native";

const Home = ({ navigation }) => {
  const [photoShops, setPhotoShops] = useState();

  useEffect(() => {
    axios({
      method: "get",
      url: "http://172.30.1.25:4000/getPhotoShop",
      responseType: "json",
    })
      .then(({ data, status }) => {
        if (status == 200) setPhotoShops(data);
      })
      .catch((res) => {
        console.log(res);
      });
  }, []);

  return (
    <SafeCon>
      <ListCard>
        {photoShops &&
          photoShops.map((val, idx) => {
            return (
              <Card key={val.seq}>
                <Image source={val.presnet_img} />
                <Text>{val.title}</Text>
              </Card>
            );
          })}
      </ListCard>
      <Button title="zz"></Button>
    </SafeCon>
  );
};

export default Home;
